import { Link , Route} from "wouter";
import App from "./App";
import './main.css'
import Home from './pages/Home';
import SearchResults from './pages/SearchResults';
import Details from './pages/Details';
import { GifsContextProvider } from './Hooks/GifsContext';

export default function Main() {

    return (
        <section className="main">
            <Route path="/">
                <h1 className="title-main">GIFWORLD</h1>
                <h4>Welcome to Gif World, your ultimate destination for discovering, sharing, and enjoying gifs! Dive into our vast collection, explore trending gifs, and uncover hidden gems tailored to your interests</h4>
                <Link to='/home'>
                    <button className="button-main">
                        Start Exploring
                    </button>
                </Link>
            </Route>
            <GifsContextProvider>
            <Route component={Home} path='/home' />
            <Route component={SearchResults} path='/search/:keyword' />
            <Route component={Details} path='/gif/:id' /> 
          </GifsContextProvider>
        </section>
    )
}
